import Home_bg from "../Background/home_bg.jpg";
import { Box } from "@chakra-ui/layout";
import { useParams } from "react-router-dom";

export default function Product() {
  const { kind } = useParams();
  return (
    <Box
      w="100vw"
      h="100vh"
      bgColor="#ffe067"
      bgImg={Home_bg}
      bgRepeat={"no-repeat"}
      bgSize={"100% auto"}
    ></Box>
  );
}
